import React from 'react';
import styled from 'styled-components'

const ContentHome = styled.div`
    height : 100vh;
    width : 100%;
    background-color : #f1f1f1;
    display : flex;
    align-items : center;
`;

 export default function App() {
    return (
        <ContentHome>
            <h1>Hello World</h1>
        </ContentHome>
    );
}
